import { NavLink } from "react-router-dom";

const Navigation = ({ links }) => {
  return (
    <div>
      <ul>
        {Object.keys(links).map(([name, link]) => {
          <li>
            <NavLink key={name} to={links[name]}>
              {link}
            </NavLink>
          </li>;
        })}
      </ul>
    </div>
  );
};

export default Navigation;
